def calcBallCircPoints(ball_width,ball_height):
    BALL_CIRCUMFRENCE_POINTS =[]
    for i in range(0,ball_width):
        for j in range(0,ball_height):
            r = ((i-ball_width/2) ** 2 + (j-ball_height/2) ** 2) ** 0.5
    
            if r <= ball_width/2:
                BALL_CIRCUMFRENCE_POINTS.append([i,j])
    
    for i in range(0,ball_width):
        for j in range(0,ball_height):
            r = ((i-ball_width/2) ** 2 + (j-ball_height/2) ** 2) ** 0.5
            if r <= ball_width/2-1:
                BALL_CIRCUMFRENCE_POINTS.remove([i,j])
    return BALL_CIRCUMFRENCE_POINTS
def readLevel(x): #is used for easier level input
   global BRICK_MATRIX
   bricks_x=[]
   bricks_y=[]
   bricks_lives=[]
   for i in range(0,len(x)):
      if x[i]!=0:
         bricks_x.append(BRICK_MATRIX[i][0])
         bricks_y.append(BRICK_MATRIX[i][1])
         bricks_lives.append(x[i])
   return [bricks_x,bricks_y,bricks_lives]
def genLvl(bricks): # can generate level based on amount of bricks 
   global BRICK_MATRIX
   bricks_x=[]
   bricks_y=[]
   bricks_lives=[]
   for i in range(0,bricks):
      temporary=BRICK_MATRIX[random.randrange(0,len(BRICK_MATRIX))]
      alreadyin=False
      for j in range(0,len(bricks_x)):
         if temporary[0] == bricks_x[j] and temporary[1] == bricks_y[j]:
            bricks_lives[j]+=1
            alreadyin=True
      if not alreadyin:
         bricks_x.append(temporary[0])
         bricks_y.append(temporary[1])
         bricks_lives.append(1) 
   return [bricks_x,bricks_y,bricks_lives]
